    false,nt"url": null,nt"notes": "This annual narrative report for Ottawa
    National Wildlife Refuge, Cedar Point National Wildlife Refuge, West Sister Island
    National Wildlife Refuge, Navarre Unit, and Darby Unit outlines Refuge accomplishments
    during the 1975 fiscal year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, mammals, and raptors- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, and
    vegetation control. Resource management is outlined; topics include fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, violations, and safety.",nt"license_title":
